   "source": [
    "# Crer des donnes fictives pour reprsenter diffrentes espces de fleurs\n",
    "set.seed(123)\n",
    "n <- 150\n",
    "species <- sample(c(\"Iris-setosa\", \"Iris-versicolor\", \"Iris-virginica\"), n, replace = TRUE)\n",
    "petal_length <- rnorm(n, mean = c(1.5, 4, 6), sd = c(0.2, 0.4, 0.5))\n",
    "petal_width <- rnorm(n, mean = c(0.3, 1.3, 2), sd = c(0.1, 0.3, 0.4))\n",
    "\n",
    "# Crer un dataframe avec les donnes\n",
    "data <- data.frame(species, petal_length, petal_width)\n",
    "\n",
    "# Dfinir des couleurs vives pour chaque espce\n",
    "colors <- c(\"Iris-setosa\" = \"red\", \"Iris-versicolor\" = \"blue\", \"Iris-virginica\" = \"green\")\n",
    "\n",
    "# Crer une visualisation avec un nuage de points color par espce\n",
    "plot(data$petal_length, data$petal_width, col = colors[data$species], pch = 19,\n",
    "     xlab = \"Longueur de ptale\", ylab = \"Largeur de ptale\", main = \"Fleurs Iris\",\n",
    "     xlim = c(0, 7), ylim = c(0, 3))\n",
    "\n",
    "# Ajouter une lgende\n",
    "legend(\"topright\", legend = unique(data$species), col = unique(colors), pch = 19, cex = 1)\n"
   ]
  },
